import { Link } from "react-router-dom";
import React, { useState } from 'react';
import logo from '../logo_transparent_bg.png'; // Import the logo image correctly
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faInstagram } from '@fortawesome/free-brands-svg-icons';
import { faCartShopping, faBars, faShoppingCart } from '@fortawesome/free-solid-svg-icons'

function NavBar() {
    const [showMenu, setShowMenu] = useState(false);

    const toggleMenu = () => {
        setShowMenu(!showMenu);
    };

    return (
        <nav className="bg-blackShade border-gray-200 dark:bg-gray-900">
            <div className="max-w-screen-xl flex flex-wrap items-center justify-between mx-auto p-4">
                <Link to="/" className="flex items-center space-x-3 rtl:space-x-reverse">
                    <img src={logo} className="h-24" alt="TK" />
                </Link>
                <button
                    data-collapse-toggle="navbar-default"
                    type="button"
                    className="inline-flex items-center p-2 w-10 h-10 justify-center text-sm text-white rounded-lg md:hidden hover:bg-gray-100 hover:text-blackShade"
                    onClick={toggleMenu}
                    aria-controls="navbar-default"
                    aria-expanded={showMenu ? "true" : "false"}
                >
                    <svg className="w-5 h-5" aria-hidden="true" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 17 14">
                        <path stroke="currentColor" strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M1 1h15M1 7h15M1 13h15"/>
                    </svg>
                </button>
                <div className={`hidden w-full md:flex md:w-auto ${showMenu ? 'block' : 'hidden'}`} id="navbar-default">
                    <ul className="font-medium flex flex-col p-4 md:p-0 mt-4 rounded-lg bg-blackShade md:flex-row md:space-x-8 rtl:space-x-reverse ">
                        <li>
                            <Link to="/" className="text-2xl font-PT_Serif block py-2 px-3 text-white" aria-current="page">Home</Link>
                        </li>
                        <li>
                            <Link to="/about" className="text-2xl font-PT_Serif block py-2 px-3 text-white">About</Link>
                        </li>
                        <li>
                            <Link to="/contact" className="text-2xl font-PT_Serif block py-2 px-3 text-white">Contact</Link>
                        </li>
                        <li>
                            <Link to="/store" className="text-2xl font-PT_Serif block py-2 px-3 text-white">Store</Link>
                        </li>
                        <li>
                            <Link to="/cart"><FontAwesomeIcon className="text-white text-2xl py-2 px-3 block font-PT_Serif" icon={faInstagram}/></Link>
                        </li>
                        <li>
                        <Link to="/cart"><FontAwesomeIcon className="text-white text-2xl py-2 px-3 block font-PT_Serif" icon={faShoppingCart}/></Link>
                        </li>
                    </ul>
                </div>
            </div>
        </nav>
    );
}

export default NavBar;
